import '../../styles/login/login.css'


const chooseLoginButton = ({name}) => {
    return (
        <div className='choose-login-button'>
            <h1></h1>
        </div>
    )
}

const LeftContainer = () => {
    return (
        <div className='half-login-container left-login-container'>

        </div>
    )
}

const RightContainer = () => {
    return (
        <div className='half-login-container right-login-container'>

        </div>
    )
}

const ChooseLogin = () => {
    return (
        <div className="fullcontainer">
            <LeftContainer />
            <RightContainer />
        </div>
    )

}

export default ChooseLogin
